Aitheantas Ceadúnais, a bheith ina aitheantas uathúil domhanda le haghaidh ceadúnais nó conartha faoina ngintear míreanna, a chuirtear faoi phróiseáil agus/nó a íoctar as, a thógáil trí chur le chéile:
 - cód gníomhaireachta eisithe ISO/IEC 15459;
 - uimhir ceadúnais nó conartha a réitíonn le sonraíochtaí an ghníomhaireachta eisithe ábhartha;
 agus sin:
 - comhdhéanta de charachtair alfabhéiteacha uachtair agus/nó uimhriúla amháin;
 - uathúil (is é sin, tá sé difriúil ó aon aitheantas eile comhlíontach ISO/IEC 15459) laistigh de réimse an ghníomhaireachta eisithe;
 - nach féidir a dhíorthú ó aon aitheantas eile comhlíontach ISO/IEC 15459, eisithe faoin ghníomhaireacht chéanna eisithe, trí charachtair shimplí a chur leis, nó a bhaint dá dheireadh.

Cód ceantair iascaireachta FAO mar a shainmhínítear ag Roinn Iascaigh agus Uisceachais FAO (http://www.fao.org. Cuardaigh le haghaidh suíomh-fochéime Cód Ceantair Iascaireachta).
Gach carachtar den fho-chomhshraith GS1 Ginear lta a shainmhínítear de ISO/IEC 646 ceadaithe.
Samplaí:
18L37.1.3 Muir na Meánmhara Thiar, An tSairdín;
18L47.B.1 An tAtlantach, Oirdheisceart, Rannán SEAFO, EEZ na Namaibe;
18L67 An tAigéan Ciúin, Oirthuaisceart.

Cód Suímh '26L', a bheith ina chód a aithníonn suíomh nó limistéar geografach, nó grúpa gaolmhar de shuímh nó limistéir, a bhfuil ábharthacht aige maidir le hidirbheart gaolmhar agus a chomhlíonann ceann de na struchtúir a shainmhínítear i (a) go (f) thíos:
a) dhá charachtar alfabhéiteach uachtair a fhreagraíonn do chód dhá alfa ISO 3166-1 den tír ina bhfuil, nó a bhfuil comhdhéanta di, na suíomh(anna) nó limistéar(anna);
b) trí charachtar alfabhéiteach uachtair a fhreagraíonn do chód IATA an aerfoirt nó na cathrach in, gar do, nó a bhfuil comhdhéanta di, na suíomh(anna) nó limistéar(anna);
c) ceithre charachtar nó níos mó a bhfuil an chéad trí cinn acu ag freagairt do chód tíre ISO 3166-1 ina dhiaidh sin lúibín (-), leis an iarmhéid a bheith ina chód poist sa tír ábhartha;
d) ceithre charachtar nó níos mó a bhfuil an chéad trí cinn acu ag freagairt do chód tíre ISO 3166-1 ina dhiaidh sin ponc (.), leis an iarmhéid a bheith ina chód fo-roinne tíre ISO 3166-2 sa tír ábhartha;
e) cúig charachtar alfabhéiteach uachtair a fhreagraíonn do chód UN/LOCODE an cheantair in, gar do, nó a bhfuil comhdhéanta di, na suíomh(anna) nó limistéar(anna);
f) an comhcheangal, nach lú ná seacht nó níos mó ná 35 carachtar ar fhad, de:
- cód gníomhaireachta eisithe ISO/IEC 15459;
- cód suímh, atá comhdhéanta de charachtair a tharraingítear ón tacar {A-Z; 0-9} a réitíonn le sonraíochtaí an ghníomhaireachta eisithe ábhartha.

Suíomh Imeachta UN /LOCODE.
