Formáid:
• DI (an3);
• Cineál modh(anna) measúnaithe comhréireachta atá leagtha amach in Iarscríbhinn II chuig Treoir 2014/90/AE a úsáidtear le haghaidh an mheasúnaithe comhréireachta (a1);
• Uimhir aitheantais an chomhlachta fógartha a shannann an Coimisiún de réir pointe 3.1 d’Iarscríbhinn IV chuig Treoir 2014/90/AE (n4);
• Teastas (an5...20)

