 - cód gníomhaireachta eisithe ISO/IEC 15459;
 - uimhir trealaimh a réitíonn le sonraíochtaí an ghníomhaireachta eisithe ábhartha; agus sin:
 - comhdhéanta de charachtair alfabhéiteacha uachtair agus/nó uimhriúla amháin;
 - uathúil (is é sin, tá sé difriúil ó aon aitheantas eile comhlíontach ISO/IEC 15459) laistigh de réimse an ghníomhaireachta;
 - nach féidir a dhíorthú ó aon aitheantas eile comhlíontach ISO/IEC 15459, eisithe faoin ghníomhaireacht chéanna, trí charachtair shimplí a chur leis, nó a bhaint dá dheireadh.
Léitheoir ID.
Aitheantas trealaimh, a bheith ina aitheantas uathúil domhanda le haghaidh gléas, mír trealaimh nó instealladh de iarratas ríomhaireachta.

Cód Suímh UPU, is cód é a aithníonn suíomh nó limistéar geografach, nó grúpa gaolmhar de leithéidí suíomhanna nó limistéir, a bhfuil ábharthacht aige le haghaidh idirbhirt ghaolmhaire agus a chomhlíonann ceann de na struchtúir a shainmhínítear i a) go g) thíos: 
a) dhá charachtar alfaibéiteacha ceannlitreacha a fhreagraíonn do chód dhá alfa tíre ISO 3166-1 den tír ina bhfuil, nó as a dtagann, na suíomh(anna) nó limistéar/limistéir; 
b) trí charachtar alfaibéiteacha ceannlitreacha a fhreagraíonn do chód IATA an aerfoirt nó na cathrach atá, gar do, nó as a dtagann, na suíomh(anna) nó limistéar/limistéir; 
c) ceithre charachtar nó níos mó a bhfuil na chéad trí cinn acu ag freagairt do chód tíre ISO 3166-1 ina dhiaidh sin stríoc (-), agus an chuid eile ina chód poist sa tír ábhartha; 
d) ceithre charachtar nó níos mó a bhfuil na chéad trí cinn acu ag freagairt do chód tíre ISO 3166-1 ina dhiaidh sin ponc (.), agus an chuid eile ina chód fo-roinn tíre ISO 3166-2 sa tír ábhartha; 
e) cúig charachtar alfaibéiteacha ceannlitreacha a fhreagraíonn do UN/LOCODE na limistéire atá, gar do, nó as a dtagann, na suíomh(anna) nó limistéar/limistéir; 
f) sé charachtar alfa-uimhriúla ceannlitreacha a fhreagraíonn do chód IMPC UPU a leithroinntear de réir chaighdeán S34 UPU; 
g) an comhcheangal, nach lú ná seacht gcarachtar agus níos mó ná 25 carachtar ar fhad, de: 
 - cód eisitheora a leithroinntear de réir chaighdeán S31 UPU; 
 - cód suímh, atá comhdhéanta de charachtair a tharraingítear ón tacar {A-Z; 0-9} a fhreagraíonn do shonraíochtaí an eisitheora ábhartha.

Clár Ceadúnais le Sonraí Seirbhíse agus Cód Suímh is struchtúr sonraí comhdhéanta é, ag cloí le sonrúchán i gcaighdeán S25 UPU, a chuimsíonn sonrúchán de:
 - aitheantóir míre atá comhlíontach le ISO/IEC 15459;
 - aitheantóir sonraí 5U atá comhlíontach le sonrúchán an tseirbhís a chuirfear ar fáil i leith na míre;
 - aitheantóir sonraí 17U atá comhlíontach le cód suímh UPU nó aitheantóir sonraí 18U atá comhlíontach le cód suímh UPU cáilithe.
 Nóta - Le haghaidh tuilleadh sonraí, féach le do thoil ar chaighdeán S25 UPU. Is féidir an difríocht idir cód suímh UPU simplí (DI 17U) agus cód suímh UPU cáilithe (DI 18U) a chinneadh ón gcéad charachtar. Má tá sé seo uimhriúil, baineann 18U leis; má tá sé alfaibéiteach, baineann 17U leis.

