Dáta Cáilithe, ag comhdhéanamh de:
- cód eisitheora ISO/IEC 15459;
- cáilíochtóir dáta de réir shonraíochtaí an eisitheora sin;
- dáta a bhfuil a fhormáid agus a léirmhíniú ag cloí le sonraíochtaí an eisitheora sin don cháilíochtóir dáta sin.

Dearbhú de Chatagóir Ábhair Pacáistithe*, Cód* agus Meáchan le haghaidh ábhar pacáistithe ar leith a úsáidtear i bpacáistiú ar leith de réir threoir AE maidir le pacáistiú agus dramhaíl phacáistithe. (Catagóir ábhair agus cód sainmhínithe in Iarscríbhinn M).
12ECCMMMMMMNNNNNUU áit: - '12E' (an3) is é an Aitheantóir Sonraí;
 - 'CC' (n2) is é Catagóir an Ábhair de réir Iarscríbhinn M;
 - 'MMMMMM' (an1...6) is é Cód an Ábhair de réir Iarscríbhinn M;
 - 'NNNNN' (n5) Meáchan an Ábhair, lena n-áirítear pointe deachúil (e.g., 12.12);
 - 'UU' (an2) is é Aonad tomhais don mheáchan (e.g., KG, GR, LB nó OZ de réir ANSI X12.3 mar atá in Iarscríbhinn D).

