CF [Oibreoir coimeádáin];
CN [Consignee];
CS [Consaladóir];
DEI [Oibreoir long/captaen na long];
FA [Cód foirne oibríochtúla];
IM [Allmhaireoir];
MF [Monaróir];
OS [Seoltóir];
SE [Díoltóir];
ST [Seol Chuig];
UC [Consignee deiridh].

Uimhir an Chonsainí.
Is féidir leis an uimhir aitheantais uathúil a bheith ina hUimhir CBL IRS, EIN, SSN, nó an uimhir a shanntar ag CBP, mar is gá don Chomhad Slándála. Ní mór na formáidí seo a leanas a úsáid amháin: IRS EIN: NN-NNNNNNN;
IRS EIN le síneadh:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
Uimhir a shanntar ag CBP: YYDDPP-NNNNN.
